function authenticate(resp){
    return dispatch =>{
        console.log('AAAAAAAAAAAAAAAAaa',res.payload);
        dispatch({
            type : 'authenticate',
            businesscategory : res.payload.businesscategory,
            businessId : res.payload.id,
        })
    }
}

export default {
    authenticate
}
